// src/Navbar.js
import React from 'react';

function Navbar() {
  return (
    <nav className="navbar navbar-expand-lg navbar-dark bg-dark">
      <div className="container">
        <a className="navbar-brand" href="/">
          <img
            src="src\assets\logo.png"
            alt="Your Logo"
            width="50"
            height="30"
          />
		  My Mensa App
        </a>
      </div>
    </nav>
  );
}

export default Navbar;
